  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:11.419152\",\n\t\"name\": \"akutan-alaska-bottomfish-harbor-study-feasibility-stage-planning-aid-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Six alternatives are presently being studied
  by the Corps of Engineers, in conjunction with facilitating construction of a bottomfish
  harbor at Akutan Harbor located on Akutan Island in the Aleutian Islands. The alternatives
  represent a variety of engineering designs in a variety of topographic areas. Even
  though the environmental impacts for each alternative fall into similar categories,
  the extent and magnitude of concern will vary between them; therefore, we have preliminarily
  determined that the Akutan Point alternative is the least environmentally acceptable
  site and should be avoided. The Head of Bay alternative is also classified as least
  environmentally acceptable but to a lesser degree than Akutan Point. Those alternatives
  more environmentally acceptable for project construction include Salthouse Cove,
  South Beach, Whaling Station, and Mid-Harbor (North and South).\",\n\t\"license_title\":
